import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";
import "./Home.css";
import stImg from "./st.jpg"

export default class Home extends Component {
  render() {
    return (
        <Container className="homeContainer" fluid>
          <Row>
            <Col><img className="img1" src={stImg} alt="Süleyman TAŞÇI"></img></Col>
            <Col>2 of 2</Col>
          </Row>
          <Row>
            <Col>1 of 2</Col>
            <Col>2 of 2</Col>
          </Row>
        </Container>
    );
  }
}
